import React from "react";
// import {Route, Switch, Link} from 'react-router-dom';
import './ChatBox.css';


export default function ChatBox(props){

    return(
        <div className="ChatBox">
            <h1>Chatbox</h1>
            <section id="chat" class="boxshadow">

            </section>
            <section id="user" class="boxshadow">
                <input type="text" value="Username" id="username" class="form-control"/>
                <textarea id="message" class="form-control" handle></textarea>
                <button type="submit" id="send-btn" class="btn">Send</button>
            </section>
        </div>
    )
}
